// src/services/api.service.js
import axios from 'axios';
import { API_CONFIG } from '../config/api.config';

// Create axios instance with proper configuration for CORS
const apiClient = axios.create({
  baseURL: API_CONFIG.BASE_URL,
  timeout: API_CONFIG.TIMEOUT,
  headers: {
    'Content-Type': 'application/json',
    'Accept': 'application/json',
    'Access-Control-Allow-Origin': '*'
  },
  withCredentials: false // Keep false to avoid CORS preflight issues
});

// Add request interceptor for logging and debugging
apiClient.interceptors.request.use(
  config => {
    const url = config.baseURL + config.url;
    console.log(`üöÄ API Request: ${config.method?.toUpperCase()} ${url}`);

    // Add timestamp to help with debugging
    config.metadata = { startTime: new Date() };

    return config;
  },
  error => {
    console.error('‚ùå Request Error:', error);
    return Promise.reject(error);
  }
);

// Add response interceptor for logging and error handling
apiClient.interceptors.response.use(
  response => {
    const duration = new Date() - response.config.metadata.startTime;
    const url = response.config.baseURL + response.config.url;

    console.log(`‚úÖ API Response: ${response.config.method?.toUpperCase()} ${url} - Status: ${response.status} (${duration}ms)`);

    return response;
  },
  error => {
    const duration = error.config?.metadata ? new Date() - error.config.metadata.startTime : 0;
    const url = error.config ? error.config.baseURL + error.config.url : 'unknown';

    // Handle different types of errors
    if (error.response) {
      // Server responded with error status
      console.error(`‚ùå API Error: ${error.config?.method?.toUpperCase()} ${url} - Status: ${error.response.status} (${duration}ms)`, error.response.data);
    } else if (error.request) {
      // Request was made but no response received (likely CORS)
      console.error(`üîå Network/CORS Error: ${error.config?.method?.toUpperCase()} ${url} - No response received (${duration}ms)`);
      console.error('This is likely a CORS issue. Request details:', {
        url: url,
        method: error.config?.method,
        timeout: error.config?.timeout,
        headers: error.config?.headers
      });
    } else {
      // Something happened in setting up the request
      console.error(`‚öôÔ∏è Setup Error: ${error.message}`);
    }

    return Promise.reject(error);
  }
);

const apiService = {
  // Health check methods
  checkHealth: async () => {
    try {
      console.log('üè• Checking API health...');
      const response = await apiClient.get(API_CONFIG.ENDPOINTS.HEALTH);
      console.log('‚úÖ Health check successful:', response.data);
      return response.data;
    } catch (error) {
      console.error("‚ùå Health check failed:", error);

      // Provide more specific error handling for CORS issues
      if (error.code === 'ERR_NETWORK' || !error.response) {
        throw new Error('Network error - possibly CORS issue. Check if backend server is running and CORS is configured correctly.');
      }

      throw new Error(error.response?.data?.message || 'Health check failed');
    }
  },

  checkApiStatus: async (endpoint) => {
    console.log(`üîç Checking API status for endpoint: ${endpoint}`);
    try {
      const response = await apiClient.get(endpoint);
      console.log(`‚úÖ Status check successful for ${endpoint}:`, response.data);

      // Handle various success scenarios
      if (response.status === 200 || response.status === 304) {
        return { status: "success", data: response.data };
      }

      if (response.data && response.data.status) {
        return { status: response.data.status === "ok" ? "success" : "error", data: response.data };
      }

      return { status: "success", data: response.data };
    } catch (error) {
      console.error(`‚ùå API status check failed for ${endpoint}:`, error.message);

      // Handle CORS/Network errors
      if (error.code === 'ERR_NETWORK' || !error.response) {
        return { 
          status: "error", 
          error: 'Network error - possibly CORS issue'
        };
      }

      return { 
        status: "error", 
        error: error.response?.data?.message || error.message || 'Status check failed' 
      };
    }
  },

  // Movie methods
  getMovies: async () => {
    try {
      console.log('üé¨ Fetching movies...');
      const response = await apiClient.get(API_CONFIG.ENDPOINTS.MOVIES);
      console.log('‚úÖ Movies fetched successfully:', response.data?.length || 'unknown count');
      return response.data;
    } catch (error) {
      console.error("‚ùå Failed to fetch movies:", error);
      throw new Error(error.response?.data?.message || 'Failed to fetch movies');
    }
  },

  getMovie: async (id) => {
    try {
      console.log(`üé¨ Fetching movie with ID: ${id}`);
